let Elements = null;
let Page = null;

App.Events.DOMContentLoadedEvent = () => {
    // Creating the Elements and Page instances
    Elements = new ElementsHandler;
    Page = new PageHandler;

    // If there's an anchor defined it'll scroll down here and purge the hash from the URI here
    // using the HistoryAPI by the browser
    App.Handler.AnchorHandler();

    // Iterating through all existing App.ContentElements
    // and calling their callbacks only if the required element
    // exists in the current client's page
    App.ContentElements.forEach(ceData => {
        const id = ceData.id;
        const callback = ceData.callback;

        if (Elements.exists(id)) {
            callback(id, ceData);
        }
    });

    // Same as above just splitted as IRREs for an easier overview
    App.ContentElements.IRREs.forEach(irreData => {
        const id = irreData.id;
        const callback = irreData.callback;

        if (Elements.exists(id)) {
            callback(id, irreData);
        }
    });

    // Loading/registering all window-related events
    App.Events.WindowLoadEvent();
    App.Events.WindowScrollEvent();
    App.Events.WindowResizeEvent();

    // Init of a view, if defined (e.g. 'index')
    if (App.isNotUndefined(App.Views[App.view])) {
        App.Views[App.view]();
    }

    // Registration of DOM-Click event-listeners
    App.Events.RegisterDOMClickEvents();
};

App.Handler.AnchorHandler = () => {
    const hash = location.hash;

    if (
        hash != '' &&

        // Checks whether the hash does not starts as a number
        !hash.replace('#', '').match(/^\d/)
    ) {
        const $element = $(hash);
        const $ce = $element.parents('.ce');

        let adjustment = 0;

        if ($ce.hasClass('frame-space-before-default')) {
            adjustment += -16;
        }

        if ($ce.hasClass('frame-space-before-small')) {
            adjustment += -32;
        }

        if ($ce.hasClass('frame-space-before-medium')) {
            adjustment += -48;
        }

        if ($ce.hasClass('frame-space-before-large')) {
            adjustment += -64;
        }

        if ($ce.hasClass('frame-space-before-extra-large')) {
            adjustment += -80;
        }

        $(hash).scrollHere(adjustment);
    }
};

class ElementsHandler {
    /**
     * The all-array includes all Content-Elements of the side
     * provided with a 'data-ctype' attribute. Their keys are
     * equal to a Content-ELement its UID to e.g. doing XHR-requests
     * with UIDs easier or anything else UID-related.
     * 
     * @param {Array}
     */
    all = [];

    /**
     * Constructor to initialize and register all elements which
     * has been rendered in the current page request.
     * 
     * @returns {void}
     */
    constructor() {
        const that = this;

        this.$body = $('body');

        this.$header = $('#header');
        this.$burger = $('#hamburger');
        this.$content = $('#content');
        this.$footer = $('#footer');

        $('[data-ctype]').each((i, element) => {
            const uid = $(element).data('uid');
            const ctype = $(element).data('ctype');

            if (App.isUndefined(that.all[ctype])) {
                that.all[ctype] = [];
            }

            if (!that.all[ctype].includes(uid)) {
                that.all[ctype][uid] = element;
            }
        });
    }

    /**
     * @function findByCType
     * @description Finds all elements loaded at the current site by the provided CType.
     * 
     * @param {String} CType
     * 
     * @returns {String}
     */
    findByCType = CType => {
        const nodes = this.all[CType];

        if (App.isUndefined(nodes)) {
            return [];
        }

        return nodes;
    }

    /**
     * @function findByN
     * @description Retrieves the n element by the provided CType. N is by default 0.
     * 
     * @param {String} CType
     * @param {Number} n
     * 
     * @returns {HTMLElement}
     */
    findByN = (CType, n = 0) => {
        let elements = this.all[CType];

        if (App.isNotUndefined(elements)) {
            elements = elements.findArrByIndex(n);
        }

        return elements;
    }

    /**
     * @function findByUid
     * @description Retrieves the node-element of the DOM by the provided UID.
     * 
     * @param {String} uid
     * 
     * @returns {null|HTMLElement}
     */
    findByUid = (uid, parentid = null) => {
        if (parentid === null) {
            let $element = null;

            $('[data-uid="' + uid + '"]').each((i, elementNode) => {
                if (!$(elementNode).parents('[data-uid="' + parentid + '"]').exists()) {
                    $element = $(elementNode);
                }
            });

            if ($element === null) {
                return null;
            }

            return $element.get(0);
        }

        const $parent = $('[data-uid="' + parentid + '"]');

        return $('[data-uid="' + uid + '"]', $parent).get(0);
    }

    /**
     * @function exists
     * @description Checks whether the provided CType exists in the current page.
     * 
     * @param {String} ctype
     * 
     * @returns {Boolean}
     */
    exists = ctype => this.findByCType(ctype).length > 0
}

class PageHandler
{
    /**
     * @type {boolean}
     * @description Rootpage state of the current TYPO3 page
     */
    rootPage = false

    constructor() {
        if(Elements.$body.data('isrootpage')) {
            this.rootPage = true;
        }
    }

    /**
     * @function isRootPage
     * @description Checks if the page is a root page
     * 
     * @returns {boolean}
     */
    isRootPage = () => this.rootPage

    /**
     * Checks whether the provided browser name is the client's current browser
     * 
     * @param {string} browser
     * 
     * @returns {boolean}
     */
    isBrowser = browser => {
        let isBrowser = false;
            browser = browser.toLowerCase();

        switch (browser) {
            case 'firefox':
                isBrowser = navigator.userAgent.search('Firefox');
                break;
            default:
                break;
        }

        return isBrowser === true;
    }
}

