App.Utility.BreakpointUtility = () => {
    return {
        view: App.getView(),
        breakpointList: App.getVar("BREAKPOINT_LIST")
    };
};

// Media-Query-likely condition.
// If the browser width is smaller than a view e.g. "lg".
App.Utility.BreakpointUtility.down = view => App.getWidth() < App.Utility.BreakpointUtility().breakpointList[view];
App.Utility.BreakpointUtility.downEquals = view => App.getWidth() <= App.Utility.BreakpointUtility().breakpointList[view];

// Media-Query-likely condition.
// If the browser width is greater than a view e.g. "lg".
App.Utility.BreakpointUtility.up = view => App.getWidth() > App.Utility.BreakpointUtility().breakpointList[view];
App.Utility.BreakpointUtility.upEquals = view => App.getWidth() >= App.Utility.BreakpointUtility().breakpointList[view];

// Checks if 2 given views (e.g. between("sm", "lg")) are between the current browser's width.
App.Utility.BreakpointUtility.between = (minView, maxView) => {
    const min = App.getVar[minView];
    const max = App.getVar[maxView];

    return App.getWidth().isBetween(min, max);
};

App.Utility.EqualHeightUtility = ($row, targetedSelector = '> div') => {
    let height = 0;

    $(targetedSelector, $row).removeAttr('style');

    $(targetedSelector, $row).each((i, columnNode) => {
        const columnHeight = $(columnNode).outerHeight();

        if(columnHeight > height) {
            height = columnHeight;
        }
    });

    $(targetedSelector, $row).css('height', height);
};

/**
 * @function App.Utility.RemoveHashUtility
 * @description Removes the entire hash of the location.href and updates it in the URI bar.
 * 
 * Credits: https://stackoverflow.com/questions/1397329/how-to-remove-the-hash-from-window-location-url-with-javascript-without-page-r#5298684
 * 
 * @returns {void}
 */
App.Utility.RemoveHashUtility = () => {
    let scrollV,
        scrollH,
        loc = window.location;

    if ('pushState' in history) {
        history.pushState("", document.title, loc.pathname + loc.search);
    } else {
        // Prevent scrolling by storing the page's current scroll offset
        scrollV = document.body.scrollTop;
        scrollH = document.body.scrollLeft;

        loc.hash = "";

        // Restore the scroll offset, should be flicker free
        document.body.scrollTop = scrollV;
        document.body.scrollLeft = scrollH;
    }
}

/**
 * @function App.Utility.String2IdentifierUtility
 * @description Converts a given string, e.g. 'Welcome to' into 'welcome-to', an identifier.
 *              Credits @ https://stackoverflow.com/a/48000411
 * 
 * @param {*} string The string to be converted into an identifier.
 * @param {*} and Optionally. The delimeter which can be used to replace ampersand.
 * 
 * @returns {string}
 */
App.Utility.String2IdentifierUtility = (string, and = '-') => {
    return string.toString()                                                     // Convert to string
        .normalize('NFD')                                                        // Change diacritics
        .replace(/[\u0300-\u036f]/g, '')                                         // Remove illegal characters
        .replace(/\s+/g, '-')                                                    // Change whitespace to dashes
        .toLowerCase()                                                           // Change to lowercase
        .replace(/&/g, and)                                                      // Replace ampersand
        .replace(/[^a-z0-9\-]/g, '')                                             // Remove anything that is not a letter,
                                                                                 // -> number or dash
        .replace(/-+/g, '-')                                                     // Remove duplicate dashes
        .replace(/^-*/, '')                                                      // Remove starting dashes
        .replace(/-*$/, '');                                                     // Remove trailing dashes
};

