App.ContentElements.IRREs.push(
    {
        id: 'ce_productslider',

        callback: ctype => {
            $(App.CE(ctype)).each((i, ceNode) => {
                const $this = $(ceNode);
                const uid = $this.data('uid');

                App.setVar(ctype + '-' + uid, {
                    backToBegin: false
                });

                const $slider = $('.items', $this);
                const slides = $('.items .item', $this).length;

                $slider.slick({
                    infinite: false,
                    slidesToShow: 3,
                    slidesToScroll: 1,
                    arrows: true,
                    dots: true,

                    prevArrow: `
                        <button type='button' class='slick-prev'>
                            <svg aria-hidden="true" focusable="false" data-prefix="fas" data-icon="chevron-left" class="svg-inline--fa fa-chevron-left fa-w-10" role="img" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 320 512"><path fill="currentColor" d="M34.52 239.03L228.87 44.69c9.37-9.37 24.57-9.37 33.94 0l22.67 22.67c9.36 9.36 9.37 24.52.04 33.9L131.49 256l154.02 154.75c9.34 9.38 9.32 24.54-.04 33.9l-22.67 22.67c-9.37 9.37-24.57 9.37-33.94 0L34.52 272.97c-9.37-9.37-9.37-24.57 0-33.94z"></path></svg>
                        </button>
                    `,

                    nextArrow: `
                        <button type='button' class='slick-next'>
                            <svg aria-hidden="true" focusable="false" data-prefix="fas" data-icon="chevron-right" class="svg-inline--fa fa-chevron-right fa-w-10" role="img" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 320 512"><path fill="currentColor" d="M285.476 272.971L91.132 467.314c-9.373 9.373-24.569 9.373-33.941 0l-22.667-22.667c-9.357-9.357-9.375-24.522-.04-33.901L188.505 256 34.484 101.255c-9.335-9.379-9.317-24.544.04-33.901l22.667-22.667c9.373-9.373 24.569-9.373 33.941 0L285.475 239.03c9.373 9.372 9.373 24.568.001 33.941z"></path></svg>
                        </button>
                    `,

                    responsive: [
                        {
                            breakpoint: App.getVar('BREAKPOINT_LIST').lg,

                            settings: {
                                slidesToShow: 2
                            }
                        },

                        {
                            breakpoint: App.getVar('BREAKPOINT_LIST').sm,

                            settings: {
                                slidesToShow: 1
                            }
                        }
                    ]
                });

                App.Listeners.ResizeListener.push(
                    width => {
                        $slider.slick('resize');
                    }
                );

                $slider.on('afterChange', function (event, slick, currentSlide) {
                    const backToBegin = App.getVar(ctype + '-' + uid).backToBegin;

                    if (!backToBegin && currentSlide == (slides / 2)) {
                        App.setVar(ctype + '-' + uid, {
                            backToBegin: true
                        });

                        return;
                    }

                    if (backToBegin && currentSlide != (slides / 2)) {
                        App.setVar(ctype + '-' + uid, {
                            backToBegin: false
                        });
                    }

                    if (backToBegin && currentSlide == (slides / 2)) {
                        const that = this;

                        setTimeout(() => {
                            $(that).slick('slickGoTo', 0);
                        }, 1);

                        App.setVar(ctype + '-' + uid, {
                            backToBegin: false
                        });
                    }
                });

                /**
                 * @todo slick-carousel when trying to slide-back if the currentSlide = 0
                 * it should goTo the last slide, just like the upper logic here when 
                 * the currentSlide = the last slide's index it'll goTo the first (0) slide
                 */
            });
        }
    }
);

App.ContentElements.IRREs.push(
    {
        id: 'ce_slider',

        callback: (ctype, self) => {
            const $slider = $(Elements.findByN(ctype));
            const $buttons = $('button.slider-btn', $slider);

            self.$slider = $slider;
            self.$items = $('.items .item', $slider);
            self.$sliderDots = $('.slider-dots', $slider);

            $buttons.on('click', e => {
                const $this = $(e.currentTarget);

                if ($this.hasClass('prev')) {
                    self.slideTo('prev', self);
                }

                if ($this.hasClass('next')) {
                    self.slideTo('next', self);
                }
            });

            self.sliderDots(self);
        },

        /**
         * @function slideTo
         * @description Slides to the next or previous slide of the current one (which handles this logic automatically).
         * 
         * @param {String|Number} n Can be either 'next', 'prev' or the index of a slide-item
         * @param {Object} self
         * 
         * @returns {void}
         */
        slideTo: (n, self) => {
            const $currentItem = $('.item.active', self.$slider);
            let $targetedItem;

            if (typeof n == 'string') {
                if (n == 'next') {
                    $targetedItem = $currentItem.next();

                    if (!$targetedItem.exists()) {
                        $targetedItem = self.$items.eq(0);
                    }
                }

                if (n == 'prev') {
                    $targetedItem = $currentItem.prev();

                    if (!$targetedItem.exists()) {
                        $targetedItem = self.$items.eq(self.$items.length - 1);
                    }
                }

                let index = $targetedItem.data('index');
                self.sliderDotsUpdate(index, self);
            }

            if (typeof n == 'number') {
                $targetedItem = self.$items.eq(n - 1);
            }

            $currentItem.removeClass('active');
            $targetedItem.addClass('active');
        },

        /**
         * @function sliderDots
         * @description Takes care of the sliderDots - handles their click-events and slides to the fetched index-slide.
         * 
         * @param {Object} self
         * 
         * @returns {void}
         */
        sliderDots: self => {
            $('span', self.$sliderDots).each((i, spanNode) => {
                let $span = $(spanNode);

                $span.on('click', e => {
                    const $this = $(e.currentTarget);
                    const index = $this.data('index');

                    self.slideTo(index, self);

                    self.sliderDotsUpdate(index, self);
                });
            });
        },

        /**
         * @function sliderDotsUpdate
         * @description Updates the slider-dots by the provided index.
         * 
         * @param {Number} index
         * @param {Object} self
         */
        sliderDotsUpdate: (index, self) => {
            $('span.active', self.$sliderDots).removeClass('active');
            $('span[data-index="' + index + '"]').addClass('active');
        }
    }
);

App.ContentElements.IRREs.push(
    {
        id: 'ce_teaser',

        callback: ctype => {
            App.Listeners.ScrollListener.push(
                scrollTop => {
                    const $teasers = $(Elements.findByCType(ctype));

                    $teasers.each((i, itemNode) => {
                        const $this = $(itemNode);

                        if (Breakpoint.upEquals('xl')) {
                            let scale = (scrollTop / 1000) + .4;
                            let translateY = 7 - (scrollTop / 100);
                            let opacity = scale;

                            if (scale > 1) {
                                scale = 1;
                                translateY = 0;
                            }

                            if (translateY == 1) {
                                translateY = 0;
                            }

                            $('.image-view img', $this).css('transform', 'translateY(' + translateY + 'rem) scale(' + scale + ')');
                            $('.image-view img', $this).css('opacity', opacity);
                        } else {
                            $('.image-view img', $this).removeAttr('style');
                        }
                    });
                }
            );
        }
    }
);

