Array.prototype.findArrByIndex = function(index) {
    const key = this.getKeyByIndex(index);

    return this[key];
};

Array.prototype.getKeyByIndex = function(index) {
    return Object.keys(this)[index];
};

Date.prototype.format = function(format) {
    let date = this;

    if (!format) {
        format = 'dd-MM-yyyy';
    }

    let month = date.getMonth() + 1;
    let year = date.getFullYear();
 
    format = format.replace('MM', month.toString().padL(2, '0'));
 
    if (format.indexOf('yyyy') > -1) {
        format = format.replace('yyyy',year.toString());
    } else if (format.indexOf('yy') > -1) {
        format = format.replace('yy',year.toString().substr(2, 2));
    }

    format = format.replace('dd',date.getDate().toString().padL(2, '0'));
 
    let hours = date.getHours();       

    if (format.indexOf('t') > -1) {
        if (hours > 11) {
            format = format.replace('t','pm')
        } else {
            format = format.replace('t','am')
        }
    }

    if (format.indexOf('HH') > -1)
        format = format.replace('HH',hours.toString().padL(2, '0'));

    if (format.indexOf('hh') > -1) {
        if (hours > 12) {
            hours - 12;
        }

        if (hours == 0) {
            hours = 12;
        }

        format = format.replace('hh', hours.toString().padL(2, '0'));
    }

    if (format.indexOf('mm') > -1) {
       format = format.replace('mm', date.getMinutes().toString().padL(2, '0'));
    }

    if (format.indexOf('ss') > -1) {
       format = format.replace('ss', date.getSeconds().toString().padL(2, '0'));
    }

    return format;
}

String.prototype.contains = function(needle) {
    return this.includes(needle);
};

/**
 * This file SHOULD BE only containing prototypes (functions which are extending)
 * for Strings.
 * 
 * Current prototypes are:
 *  padL
 *  padR
 * 
 * Since 'this' context can't be used within ES6 arrow-functions,
 * Prototypes MUST BE declared using ES5 functions.
 */


String.prototype.padL = function(width, pad) {
    if (!width || width < 1) {
        return this;
    }
 
    if (!pad) {
        pad = ' ';
    }

    let length = width - this.length;

    if (length < 1) {
        return this.substr(0, width);
    }

    return (String.repeat(pad, length) + this).substr(0, width);
}

String.prototype.padR = function(width, pad) {
    if (!width || width < 1) {
        return this;
    }
 
    if (!pad) {
        pad = ' ';
    }

    let length = width - this.length;

    if (length < 1) {
        this.substr(0, width);
    }

    return (this + String.repeat(pad, length)).substr(0, width);
}

/**
 * @function exists
 * @description Checks whether a jQuery-object element exists or not.
 * 
 * @returns {boolean}
 */
$.fn.exists = function() {
    return App.elExists($(this));
};

/**
 * @function inViewport
 * @description Determines if the given element - $(this) - is inside the client's viewport.
 * 
 * @returns {boolean}
 */
$.fn.inViewport = function() {
    if (!$(this).exists()) {
        return null;
    }

    let elementTop = $(this).offset().top;
    const elementBottom = elementTop + $(this).outerHeight();

    let viewportTop = $(window).scrollTop();
    const viewportBottom = viewportTop + $(window).height();

    return (elementBottom > viewportTop && elementTop < viewportBottom);
};

/**
 * @function scrollHere
 * @description Scrolls to this element.
 * 
 * @param {number} adjustment
 * @param {string|number} transition
 * 
 * @returns {void}
 */
$.fn.scrollHere = function(adjustment = 0, transition = 'smooth') {
    if (!$(this).exists()) {
        console.warn('App.js: The element passed here doesn\'t exists!');

        return null;
    }

    let elementTop = $(this).offset().top + adjustment;

    $('html, body').animate({
        scrollTop: elementTop
    }, transition);
};

App.Events.DOMClickEvent.push(
    () => {
        const $accordions = Elements.findByCType('ce_accordions');

        $accordions.forEach(accordionNode => {
            const $accordion = $(accordionNode);

            $('.item .header-view', $accordion).on('click', e => {
                const $headerView = $(e.currentTarget);
                const $this = $headerView.parent();

                const $parentAccordions = $this.parents('.accordions');

                if (!$this.hasClass('active')) {
                    $('.item.active', $parentAccordions).removeClass('active').find('.rte-view').slideUp('fast');
                    $this.addClass('active').find('.rte-view').slideDown('fast');
                } else {
                    $this.removeClass('active').find('.rte-view').slideUp('fast');
                }
            });
        });
    }
);

